import React, { useState, useEffect } from 'react';
import { db } from '../firebaseConfig';
import { useNavigate, useParams, Link } from 'react-router-dom';
import { collection, doc, getDoc, getDocs, setDoc } from 'firebase/firestore';
import './ClassroomDetails.css';

const ClassroomDetails = () => {
  const [classroom, setClassroom] = useState(null);
  const [students, setStudents] = useState([]);
  const [projects, setProjects] = useState([]); // New state for projects
  const [loading, setLoading] = useState(true);
  const [newProjectName, setNewProjectName] = useState(''); // New state for new project input
  const [newProjectDescription, setNewProjectDescription] = useState('');
  const { classroomId } = useParams();

  useEffect(() => {
    const fetchClassroomDetails = async () => {
      try {
        const classroomRef = doc(db, 'classrooms', classroomId);
        const classroomSnap = await getDoc(classroomRef);
        console.log("Classroom Document:", classroomSnap.data());

        if (classroomSnap.exists()) {
          setClassroom(classroomSnap.data());

          const studentsCollection = collection(classroomRef, 'students');
          const querySnapshot = await getDocs(studentsCollection);
          const studentData = querySnapshot.docs.map(doc => doc.data());
          console.log("Student Data:", studentData);

          setStudents(studentData);
        } else {
          console.log("Classroom does not exist");
        }
      } catch (error) {
        console.error("Error fetching classroom details:", error);
      }
      setLoading(false);
    };

    fetchClassroomDetails();
  }, [classroomId]);



  const handleAddProject = async () => {
    if (!newProjectName) return; // Ensure project name is provided

    const projectRef = doc(db, 'classrooms', classroomId, 'projects', newProjectName);
    await setDoc(projectRef, {
      projectName: newProjectName,
      description: newProjectDescription || '',
    });

    // Update local state to reflect the new project
    setProjects([...projects, { projectName: newProjectName, description: newProjectDescription }]);
    setNewProjectName('');
    setNewProjectDescription('');
  };

  return (
    <div className="classroom-details">
      {loading ? (
        <p>Loading classroom details...</p>
      ) : (
        <>
          <h1>{classroom?.classID}</h1>
          <div className="classroom-buttons">
            <Link to={`/classroom/${classroomId}/manage`} className="button">Manage Classroom</Link>
            <Link to={`/classroom/${classroomId}/projects`} className="button">Projects</Link>
          </div>

          {/* Display enrolled students */}
          <div className="students-list">
            <h2>Enrolled Students</h2>
            {students.length > 0 ? (
              students.map(student => (
                <p key={student.email}>{student.lastName}, {student.firstName}</p>
              ))
            ) : (
              <p>No students enrolled yet.</p>
            )}
          </div>

          {/* Add Project Section */}
          <div className="add-project">
            <h2>Add Project</h2>
            <input
              type="text"
              placeholder="Project Name"
              value={newProjectName}
              onChange={(e) => setNewProjectName(e.target.value)}
            />
            <textarea
              placeholder="Project Description"
              value={newProjectDescription}
              onChange={(e) => setNewProjectDescription(e.target.value)}
            />
            <button onClick={handleAddProject}>Add Project</button>
          </div>

          {/* Display Projects */}
          <div className="projects-list">
            <h2>Projects</h2>
            {projects.length > 0 ? (
              projects.map(project => (
                <div key={project.projectName}>
                  <p>{project.projectName}</p>
                  <p>{project.description}</p>
                </div>
              ))
            ) : (
              <p>No projects available yet.</p>
            )}
          </div>
        </>
      )}
    </div>
  );
};

export default ClassroomDetails;
